import React, { useState, useEffect } from 'react';

function Demo() {
  const [sum, setSum] = useState(null);

  useEffect(() => {
    const importObject = {
      module: {},
      env: {
        memory: new WebAssembly.Memory({ initial: 256 }),
      },
    };

    WebAssembly.instantiateStreaming(fetch('add.wasm'), importObject)
      .then((result) => {
        const Sum = result.instance.exports.Sum;
        setSum(Sum(4, 5));
      })
      .catch((error) => {
        console.error(error);
      });
  }, []);

  return (
    <div>
      <p>First trial of embedding WebAssembly</p>
      {sum !== null ? <p>Sum: {sum}</p> : <p>Loading...</p>}
    </div>
  );
}

export default Demo;
